import React from "react";

import {
 BrowserRouter as Router,
 Link
} from "react-router-dom";

import recipe_master from '../media/recipes/recipe_master.json';

const Nav = ({color}) => {

  const pathify = (a) => {
    a = a.toLowerCase();
    a = a.replaceAll(' ', '-')
    a = a.replaceAll('-', '-')
    return a
  }

  return (
    <>
      <nav>
        {
          recipe_master.map(d =>
              (<div>
                <Link
                  // to={'/' + pathify(d.name)}
                  to={'/' + d.path}
                  >
                    {d.name}
                </Link>
              </div>)
            )
          }
      </nav>
    </>

  )
}

export default Home
